ied, including all implied warranties or conditions of merchantability, merchantable quality, fitness for a particular purpose, durability, title, and non-infringement.</p>\r\n\r\n<p>In no case shall ACCRONIC PRIVATE LIMITED, our directors, officers, employees, affiliates, agents, contractors, interns, suppliers, service providers or licensors be liable for any injury, loss, claim, or any direct, indirect, incidental, punitive, special, or consequential damages of any kind, including, without limitation lost profits, lost revenue, lost savings, loss of data, replacement costs, or any similar damages, whether based in contract, tort (including negligence), strict liability or otherwise, arising from your use of any of the service, or for any other claim related in any way to your use of the service, including, but not limited to, any errors or omissions in any content, or any loss or damage of any kind incurred as a result of the use of the service or any content posted, transmitted, or otherwise made available via the service, even if advised of their possibility. Because some states or jurisdictions do not allow the exclusion or the limitation of liability for consequential or incidental damages, in such states or jurisdictions, our liability shall be limited to the maximum extent permitted by law.</p>\r\n\r\n<h3>SECTION 12 - INDEMNIFICATION</h3>\r\n\r\n<p>You agree to indemnify, defend and hold harmless ACCRONIC PRIVATE LIMITED and our parent, subsidiaries, affiliates, partners, officers, directors, agents, contractors, licensors, service providers, subcontractors, suppliers, interns and employees, harmless from any claim or demand, including reasonable attorneys&rsquo; fees, made by any third-party due to or arising out of your breach of these Terms of Service or the documents they incorporate by reference, or your violation of any law or the rights of a third-party.</p>\r\n\r\n<h3>SECTION 13 - SEVERABILITY</h3>\r\n\r\n<p>In the event that any provision of these Terms of Service is determined to be unlawful, void or unenforceable, such provision shall nonetheless be enforceable to the fullest extent permitted by applicable law, and the unenforceable portion shall be deemed to be severed from these Terms of Service, such determination shall not affect the validity and enforceability of any other remaining provisions.</p>\r\n\r\n<h3>SECTION 14 - TERMINATION</h3>\r\n\r\n<p>The obligations and liabilities of the parties incurred prior to the termination date shall survive the termination of this agreement for all purposes.</p>\r\n\r\n<p>These Terms of Service are effective unless and until terminated by either you or us. You may terminate these Terms of Service at any time by notifying us that you no longer wish to use our Services, or when you cease using our site.</p>\r\n\r\n<p>If in our sole judgment you fail, or we suspect that you have failed, to comply with any term or provision of these Terms of Service, we also may terminate this agreement at any time without notice and you will remain liable for all amounts due up to and including the date of termination; and/or accordingly may deny you access to our Services (or any part thereof).</p>\r\n\r\n<h3>SECTION 15 - ENTIRE AGREEMENT</h3>\r\n\r\n<p>The failure of us to exercise or enforce any right or provision of these Terms of Service shall not constitute a waiver of such right or provision.</p>\r\n\r\n<p>These Terms of Service and any policies or operating rules posted by us on this site or in respect to the Service constitutes the entire agreement and understanding between you and us and govern your use of the Service, superseding any prior or contemporaneous agreements, communications and proposals, whether oral or written, between you and us (including, but not limited to, any prior versions of the Terms of Service).</p>\r\n\r\n<p>Any ambiguities in the interpretation of these Terms of Service shall not be construed against the drafting party.</p>\r\n\r\n<h3>SECTION 16 - GOVERNING LAW</h3>\r\n\r\n<p>These Terms of Service and any separate agreements whereby we provide you Services shall be governed by and construed in accordance with the laws of India and jurisdiction of Ghaziabad, Uttar Pradesh.</p>\r\n\r\n<h3>SECTION 17 - CHANGES TO TERMS OF SERVICE</h3>\r\n\r\n<p>You can review the most current version of the Terms of Service at any time at this page.</p>\r\n\r\n<p>We reserve the right, at our sole discretion, to update, change or replace any part of these Terms of Service by posting updates and changes to our website. It is your responsibility to check our website periodically for changes. Your continued use of or access to our website or the Service following the posting of any changes to these Terms of Service constitutes acceptance of those changes.</p>\r\n\r\n<h3>SECTION 18 - CONTACT INFORMATION</h3>\r\n\r\n<p>Questions about the Terms of Service should be sent to us at ______________</p>', '', '2021-02-10 18:17:36', '2021-02-10 18:17:36'),
(6, 'freelance tax consultant', 'freelance tax consultant', 'privacy-policy', '<p>&nbsp;</p>\r\n\r\n<h1><strong>Privacy Policy</strong></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ACCRONIC PRIVATE LIMITED</strong> (&quot;FROBITY&quot;) values your privacy. In this Privacy Policy (&quot;Policy&quot;), we describe the information that we collect about you when you visit our website, www.frobity.com (the &quot;Website&quot;) and use the services available on the Website (&quot;Services&quot;), and how we use and disclose that information.</p>\r\n\r\n<p>If you have any questions or comments about the Privacy Policy, please contact us at frobitypayments@gmail.com &nbsp;This Policy is incorporated into and is subject to the ACCRONIC PRIVATE LIMITED Terms of Use, which can be accessed at&nbsp;www.frobity.com/terms .&nbsp;Your use of the Website and/or Services and any personal information you provide on the Website remains subject to the terms of the Policy and <strong> ACCRONIC PRIVATE LIMITED</strong>&#39;s Terms of Use.</p>\r\n\r\n<p>In terms of the Information Technology (Intermediaries Guidelines) Rules, 2011 and the Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011, any grievance or complaint may be intimated to Anurag Sinha, Director who may be reached at GF2, Plot No. 325/1, Sector-3F, Vaishali, Ghaziabad &ndash; 201010 , India. The complaint shall be addressed within a period of 15 (fifteen) working days.</p>\r\n\r\n<h3>A. Collection of Your Personal Information</h3>\r\n\r\n<p><strong>1. COLLECTION OF PERSONAL INFORMATION</strong></p>\r\n\r\n<p>&ldquo;Personal information&rdquo; is defined to include information that whether on its own or in combination with other information may be used to readily identify or contact you such&nbsp;as:&nbsp;name, address, email address, phone number etc.</p>\r\n\r\n<p>We collect personal information from Service Professionals offering their services. This information is partially or completely accessible to all visitors using FROBITY website or mobile application, either directly or by submitting a request for a service. Service Professionals and customers are required to create an account to be able to access certain portions of our Website, such as to submit questions, participate in polls or surveys, to request a quote, to submit a bid in response to a quote, and request information. Service Professionals, if and when they create and use an account with FROBITY, will be required to disclose and provide to FROBITY information including personal contact details, bank details, personal identification details (such as PAN card, Aadhar card, phonebook, call logs etc.) and participate in polls or surveys or feedbacks etc. Such information gathered shall be utilized to ensure greater customer satisfaction and help a customer satiate their needs. The type of personal information that we collect from you varies based on your particular interaction with our Website or mobile application.</p>\r\n\r\n<p>Consumers: During the Account registration process and during your usage of FROBITY&rsquo;s website or application, we will collect information such as your name, postal code, telephone email address and other personal information. You also may provide us with your, mailing address, and demographic information (e.g., gender, age, political preference, education, race or ethnic origin, and other information relevant to user surveys and/or offers). We may also collect personal information that you post in your Offer, Profile, Wants, or Feedback, and any comments or discussions you post in any blog, chat room, or&nbsp;other correspondence site&nbsp;on the Website or mobile application, or any comments you provide during dispute resolution with other users of the Website or mobile application.</p>\r\n\r\n<p>Service Professionals: If you are a Service Professional and would like to post any information about yourself, we will require you to register for an Account. During the Account registration process, we will collect your business name, telephone number, address, zip code, a description of your services, a headline for your profile, first and last name, and email address. Other information may also be required to be provided to FROBITY whilst you avail and use FROBITY&rsquo;s website or application. In addition, you may, but are not required to, provide other content or information about your business, including photographs and videos. We also may collect payment information, such as credit card information, from you.</p>\r\n\r\n<p>FROBITY reserves the right to record the conversations between service professionals and consumers facilitated by FROBITY through the messaging/chat mechanism on the platform or the calls made through the virtual numbers provided to safeguard the privacy of consumers and service professionals. All the chat/messaging logs or call recordings can be used to but not limited to monitor and prohibit abuse, safeguard the rights of consumers and service professionals, resolve disputes.</p>\r\n\r\n<p>If we deem it necessary, in our sole and absolute discretion, we may also ask for and collect supplemental information from third parties, such as information about your credit from a credit bureau (to the extent permitted by law), or information to verify any identification details you provide during registration.</p>\r\n\r\n<p><strong>2. COLLECTION OF PERSONAL INFORMATION FROM SOCIAL NETWORKING SITES</strong></p>\r\n\r\n<p>You may log into our Website through your Facebook / Google account. If you do so, you must enter the email address and password that you use for your Facebook / Google account. We will ask that you grant us permission to access and collect your Facebook / Google basic information (this includes your name, profile picture, gender, networks, user IDs,&nbsp;list&nbsp;of friends, date of birth, email address, and any other information you have set to public on your Facebook / Google account). If you allow us to have access to this information, then we will have access to this information even if you have chosen not to make that information public.</p>\r\n\r\n<p>We store the information that we receive from Facebook / Google with other information that we collect from you or receive about you.</p>\r\n\r\n<p>Facebook / Google controls the information it collects from you. For information about how Facebook / Google may use and disclose your information, including any information you make public, please consult Facebook&#39;s / Google&rsquo;s privacy policy. We have no control over how any third party site uses or discloses the personal information it collects about you.</p>\r\n\r\n<p><strong>3. COLLECTION OF AUTOMATIC INFORMATION, USE OF COOKIES AND OTHER TRACKING DEVICES</strong></p>\r\n\r\n<p>We and our third party service providers, which include ad networks, use cookies, web beacons, and other tracking technologies to collect information about your use of our Website and Services, such as your browser type, your ISP or operating system, your domain name, your access time, the URL of the previous website you visited, your page views, your IP address, and the type of device that you use. We also track how frequently you visit our Website and use our Services. We use this information (including the information collected by our third party service providers) for Website analytics (including to determine which portions of our Website are used most frequently, what our users like/do not like), to assist us in determining relevant advertising (both on and off our Website), to evaluate the success of our advertising campaigns, and as otherwise described in this policy. Currently, we do not&nbsp;honour&nbsp;browser requests not to be tracked.</p>\r\n\r\n<p>We may obtain your device ID, which is sent to FROBITY&rsquo;s servers and used in fraud prevention efforts.</p>\r\n\r\n<p>Cookies. We and our third party service providers collect information from you by using cookies. A cookie is a small file stored on user&#39;s computer hard drive containing information about the user. The cookie helps us analyze web traffic or informs you about your use of a particular website. Cookies allow web applications to respond to you as an individual, tailoring its operations to your needs, likes and dislikes by gathering and remembering information about your preferences. When you visit the Website, we may send one or more cookies (i.e., a small text file containing a string of alphanumeric characters) to your computer that identifies your browser.</p>\r\n\r\n<p>Some of these cookies may be connected to third-party companies or websites. The terms of use of such cookies are governed by this Policy and the privacy policy of the relevant third party company or website. For example, Google measures the performance of advertisements by placing cookies on your computer when you click on ads. If you visit the Website when you have such cookies on your computer, we and Google will be able to tell that you saw the ad delivered by Google. The terms of use of these cookies are governed by this Policy and Google&#39;s Privacy Policy.</p>\r\n\r\n<p>Disabling Cookies. You can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. If you disable cookies you may be prevented from taking full advantage of the Website because it may not function properly if the ability to accept cookies is disabled.</p>\r\n\r\n<p>Clear GIFs, pixel&nbsp;tags&nbsp;and other technologies. Clear GIFs are tiny graphics with a unique identifier, similar in function to cookies. In contrast to cookies, which are stored on your computer&#39;s hard drive, clear GIFs are embedded invisibly on web pages. We may use clear GIFs (a.k.a. web beacons, web bugs or pixel tags), in connection with our Website to, among other things, track the activities of Website visitors, help us manage content, and compile statistics about Website usage. We and our third party service providers also use clear GIFs in HTML&nbsp;emails&nbsp;to our customers, to help us track&nbsp;email&nbsp;response rates, identify when our&nbsp;emails&nbsp;are viewed, and track whether our&nbsp;emails&nbsp;are forwarded.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>B. How FROBITY Uses the Information We Collect</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. HOW PERSONAL INFORMATION IS USED</strong></p>\r\n\r\n<ul>\r\n	<li>We collect your personal information and aggregate information about the use of our Website and Services to better understand your needs and to provide you with a better Website experience. Specifically, we may use your personal information for any of the following reasons</li>\r\n	<li>To provide our Services to you, including registering you for our Services, verifying your identity and authority to use our Services, and to otherwise enable you to use our Website and our Services;</li>\r\n	<li>For customer support and to respond to your inquiries;</li>\r\n	<li>For internal record-keeping purposes;</li>\r\n	<li>To process billing and payment, including sharing with third party payment gateways in connection with Website and/or FROBITY &lsquo;s terms and Services;</li>\r\n	<li>To improve and maintain our Website and our Services (for example, we track information entered through the &quot;Search&quot; function; this helps us determine which areas of our Website users like best and areas that we may want to enhance; we also will use for&nbsp;trouble-shooting&nbsp;purposes, where applicable);</li>\r\n	<li>To periodically send promotional emails to the email address you provide regarding new from FROBITY, special offers from FROBITY or other information about FROBITY that we think you may find interesting;</li>\r\n	<li>To contact you via email, telephone, facsimile or mail, or, where requested, by text message, to deliver certain services or information you have requested;</li>\r\n	<li>For FROBITY market research purposes, including, but not limited to, the customization of the Website according to your interests;</li>\r\n	<li>We may use your demographic information (i.e., age, postal code, residential and commercial addresses, and other various data) to more effectively facilitate the promotion of services to appropriate target audiences and for other research and analytical purposes;</li>\r\n	<li>To resolve disputes, to protect ourselves and other users of our Website and Services, and to enforce our Terms of Use;</li>\r\n	<li>We also may compare personal information collected through the Website and Services to verify its accuracy with personal information collected from third parties; and</li>\r\n	<li>We may combine aggregate data with the personal information we collect about you.</li>\r\n	<li>From time to time, FROBITY may use personal information for new and unanticipated uses not previously disclosed in our Privacy Policy. If our information practices change regarding information previously collected, FROBITY shall make reasonable efforts to provide notice and obtain&nbsp;consent&nbsp;of&nbsp;any such uses as may be required by law.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>C. Electronic Newsletters, Invitations, Polls and Surveys</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At our sole discretion, FROBITY may offer any of the following free services on the Website, which you may select to use or receive at your option. Certain of the following services may require you to provide additional personal information as detailed below:</p>\r\n\r\n<p><strong>1. ELECTRONIC NEWSLETTERS</strong></p>\r\n\r\n<p>We may offer a free electronic newsletter to users. We will gather the email addresses of users who sign up for FROBITY for the newsletter mailing list. Users may remove themselves from this mailing list by opting out of receiving newsletters during the registration process, by following the link provided in each newsletter that points users to a subscription management page where the user can unsubscribe from receiving newsletters or by changing their preferences in their Profile Settings page.</p>\r\n\r\n<p><strong>2. &quot;SHARE FROBITY SERVICES&quot;</strong></p>\r\n\r\n<p>Our Website users can voluntarily choose to electronically forward a link, page, or document to someone else by clicking &quot;share FROBITY services.&quot; To do so, the user must provide his or her email address, as well as the email address of the recipient. The user&#39;s email address is used only in the case of transmission errors and, of course, to let the recipient know who sent the email. The information is not used for any other purpose.</p>\r\n\r\n<p><strong>3. POLLING</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may offer interactive polls to users so they can easily share their opinions with other users and see what our audience thinks about important issues, Services, and/or the Website. Opinions or other responses to polls are aggregated and are not identifiable to any particular user. We may use a system to &quot;tag&quot; users after they have voted, so they can vote only once on a particular question. This tag is not correlated with information about individual users.</p>\r\n\r\n<p><strong>4. SURVEYS</strong></p>\r\n\r\n<p>We may conduct user surveys from time to time to better target our content to our Website users. We will not share individual responses from these surveys with any third party. We will share aggregate data with third party service providers, partners, and other third parties. We also will post aggregate data containing survey responses on our Website; that data may be viewed and downloaded by other users of our Website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>D. Security</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We employ procedural and technological security measures, which are reasonably designed to help protect your personal information from unauthorized access or disclosure. FROBITY may use encryption, passwords, and physical security measures to help protect your personal information against unauthorized access and disclosure. No security measures, however, are 100% complete. Therefore, we do not promise and cannot guarantee, and thus you should not expect, that your personal information or private communications will not be collected and used by others. You should take steps to protect against unauthorized access to your password, phone, and computer by, among other things, signing off after using a shared computer, choosing a robust password that nobody else knows or can easily guess, and keeping your log-in and password private. FROBITY is not responsible for the unauthorized use of your information or for any lost, stolen, compromised passwords, or for any activity on your Account via unauthorized password activity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>E. Disclosure</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may share the information that we collect about you, including your personal information, as follows:</p>\r\n\r\n<p><strong>1. INFORMATION DISCLOSED TO PROTECT US AND OTHERS</strong></p>\r\n\r\n<p>We may disclose your information including Personal Information if: (i) FROBITY reasonably believes that disclosure is necessary in order to comply with a legal process (such as a court order, search warrant, etc.) or&nbsp;other legal requirement&nbsp;of any governmental authority, (ii) disclosure would potentially mitigate our liability in an actual or potential lawsuit, (iii) reasonably necessary to enforce this Privacy Policy, our Terms of Use etc. (iv) disclosure is intended to help investigate or prevent unauthorized transactions or other illegal activities, or (v) necessary or appropriate to protect our rights or property, or the rights or property of any person or entity.</p>\r\n\r\n<p><strong>2. INFORMATION DISCLOSED TO THIRD PARTY SERVICE PROVIDERS AND BUSINESS PARTNERS</strong></p>\r\n\r\n<p>We may contract with various third parties for the provision and maintenance of the Website,&nbsp;Services&nbsp;and our business operations, and FROBITY may need to share your personal information and data generated by cookies and aggregate information (collectively, &quot;information&quot;) with these vendors and service agencies. For example, we may provide your information to a credit card processing company to process your payment. The vendors and service agencies will not receive any right to use your personal information beyond what is necessary to perform its obligations to provide the Services to you. If you complete a survey, we also may share your information with the survey provider; if we offer a survey in conjunction with another entity, we also will disclose the results to that entity.</p>\r\n\r\n<p><strong>3. DISCLOSURE TO NON-AFFILIATED THIRD PARTIES IN FURTHERANCE OF YOUR REQUEST</strong></p>\r\n\r\n<p>Your request for services may be shared with third party websites with whom we have a contractual relationship in order to provide your request with maximum exposure. The post on the third party website will include the details of your request, including your location, and other contact details. Interested bidders, however, will be able to click on your request on such third party site, and will be directed to our Website where they will have access to your contact details (Partial or complete), as would any other service provider on our Website interested in bidding on your request.</p>\r\n\r\n<p><strong>4. DISCLOSURE TO OTHER USERS OF OUR WEBSITE</strong></p>\r\n\r\n<p>If you are a Service Professional, the information that you post (other than your payment information) is available to other users of our Website and our Services. Comments that users post to our Website also will be available to other visitors to our Website (see our discussion of User Generated Content below). In addition, we will post the results (in aggregate form) of surveys to our Website. If you are a consumer, name, and location, as well as the details of your request, are available to all visitors to our Website. Bidding professionals also will be permitted to see the consumer&#39;s full name, telephone number, email address and the -location</p>\r\n\r\n<p><strong>5. INFORMATION DISCLOSED TO LAW ENFORCEMENT OR GOVERNMENT OFFICIALS</strong></p>\r\n\r\n<p>We will disclose your information, including, without limitation, your name, city, state, telephone number, email address, user ID history, quoting and listing history, and fraud complaints, to law enforcement or other government officials if we are required to do so by law, regulation or other government authority or otherwise in cooperation with an investigation of a governmental authority.</p>\r\n\r\n<p><strong>6. IN THE EVENT OF A CHANGE OF CONTROL OR BANKRUPTCY</strong></p>\r\n\r\n<p>In the event that FROBITY undergoes a change in control, including, without limitation, a merger or sale of all or substantially all of FROBITY&rsquo;s assets to which this Website relates or other corporate reorganization in which FROBITY participates, and is thus merged with or acquired by a third party entity (a &quot;Successor&quot;), FROBITY hereby reserves the right to transfer the information we have collected from the users of the Website and/or Services to such Successor.</p>\r\n\r\n<p>In addition, in the event of FROBITY bankruptcy, reorganization, receivership, or assignment for the benefit of creditors, or the application or laws or equitable principles affecting creditors&#39; rights generally, FROBITY may not be able to control how your information is transferred, used, or treated and reserves the right to transfer the information we have collected from the users of the Website and/or Services to non-affiliated third parties in such event.</p>\r\n\r\n<p><strong>7. INFORMATION DISCLOSED AT YOUR REQUEST</strong></p>\r\n\r\n<p>We may share your personal information with other Registered Users to whom you explicitly ask us to send your information or if you explicitly consent to such disclosure upon receipt of a specific Service. For instance, when you contract for a specific Service with another Registered User, FROBITY will send that Registered User a notice that includes the personal information that you have chosen to allow FROBITY to reveal to users with whom you contract.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>F. Links to External Websites</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Website may contain links to other websites or resources over which FROBITY does not have any control. Such links do not constitute an endorsement by FROBITY of those external websites. You acknowledge that FROBITY is providing these links to you only as a convenience, and further agree that FROBITY is not responsible for the content of such external websites. We are not responsible for the protection and privacy of any information which you provide while visiting such external websites and such sites are not governed by this Policy. Your use of any external website is subject to the terms of use and privacy policy located on the linked to&nbsp;external&nbsp;website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>G. Updating, Deleting and Correcting Your Personal Information</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\r\n\r\n<p>You can review, correct and delete your personal information by logging into the Website and navigating to your preferences page in &quot;Edit Profile.&quot; You must promptly update your personal information if it changes or is inaccurate. Typically, we will not manually alter your personal information because it is very difficult to verify your identity remotely. Nonetheless, upon your&nbsp;request&nbsp;we will close your Account and remove your personal information from view as soon as reasonably possible based on your Account activity and in accordance with applicable law. We do retain information from closed Accounts in order to comply with the law, prevent fraud, collect any fees owed, resolve disputes, troubleshoot problems, assist with any investigations of any Registered User, enforce our Terms of Use, and take any other actions otherwise permitted by law that we deem necessary in our sole and absolute discretion. You should understand, however, that once you publicly post a Request, Offer, Want, Feedback, or any other information onto the Website, you may not be able to change or remove it. Once we have deleted or removed your Account, you agree that FROBITY shall not be responsible for any personal information that was not included within your deleted and/or removed Account that remains on the Website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>H. What Choices Do I Have Regarding Use of My Personal Information?</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may send periodic promotional or informational emails to you. You may opt-out of such communications by following the opt-out instructions contained in the email. Please note that it may take up to 10 business days for us to process opt-out requests. If you opt-out of receiving emails about recommendations or other information we think may interest you, we may still send you emails about your Account or any Services you have requested or received from us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>I. Third-Party Ad Networks</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We participate in third party ad networks that may display advertisements on other websites based on your visits to our Site as well as other websites. This enables us and these third parties to target advertisements by displaying ads for and services in which you might be interested. Third party ad network providers, advertisers, sponsors and/or traffic measurement services may use cookies, JavaScript, web beacons (including clear GIFs), Flash LSOs and other technologies to measure the effectiveness of their ads and to personalize advertising content to you. These third party cookies and other technologies are governed by each third party&#39;s specific privacy policy, and not by FROBITY&rsquo;s Policy. We may provide these third-party advertisers with information about your usage of our Site and our services, as well as aggregate or non-personally identifiable information about visitors to our Site and users of our service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>J. Your Full Name and Use of FROBITY Information</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. YOUR FULL NAME</strong></p>\r\n\r\n<p>As a Registered User of the&nbsp;Website&nbsp;you will select a Full Name during the registration process. All of your activities on the Website will be traceable to your Full Name. Certain other people, including other Registered Users with whom you have transacted business via the Website, can see a large part of your activity on the Website. If you book a service with a Registered User, cancel a scheduled service with a Registered User, receive an offer on your posted service from a Registered User, or have posted a service, FROBITY may send a notice to you or the appropriate Registered User that includes your Full Name. Thus, if you associate your real name with your Full Name, the people to whom you have revealed your name may be able to personally identify your Website activities.</p>\r\n\r\n<p><strong>2. USING INFORMATION FROM FROBITY</strong></p>\r\n\r\n<p>The Website facilitates your sharing of personal information with others in order to negotiate, provide, and use the Services. If you agree to contract for a service with another Registered User, you may need to reveal your name, email, phone number, or personal address to that individual so that the service may be performed. Please respect the privacy of others. You agree to use the information of other users solely for the following purposes: (a) FROBITY -transaction-related&nbsp;purposes; and&nbsp;(b) using Services offered through the Website.</p>\r\n\r\n<p><strong>3. ACCOUNT PROTECTION</strong></p>\r\n\r\n<p>Your password is the key to your Account. When creating your password you should use unique numbers, letters, special characters, and combinations thereof. In addition, DO NOT disclose your password to anyone. If you do share your password or your personal information with others, you are solely responsible for all actions taken via your Account. If you lose control of your password, you may lose substantial control over your personal information and be subject to legally binding actions taken on your behalf. Thus, IF YOUR PASSWORD HAS BEEN COMPROMISED FOR ANY REASON, YOU MUST IMMEDIATELY NOTIFY FROBITY TO CHANGE YOUR PASSWORD.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>K. User Generated Content</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We invite you to post content on our Website, including your comments, feedback, pictures, and any other information that you would like to be available on our Website. If you post content to our Website, all of the information that you post will be available to all visitors to our Website. If you post your own content on our Website or Services, your posting may become public and FROBITY cannot prevent such information from being used in a manner that may violate this Policy, the law, or your personal privacy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>L. Privacy Policy Updates</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THIS POLICY IS CURRENT AS OF THE EFFECTIVE DATE SET FORTH ABOVE. FROBITY MAY, IN ITS SOLE AND ABSOLUTE DISCRETION, CHANGE THIS POLICY FROM TIME TO TIME BY UPDATING THIS DOCUMENT. FROBITY WILL POST ITS UPDATED POLICY ON THE WEBSITE ON THIS PAGE. FROBITY ENCOURAGES YOU TO REVIEW THIS POLICY REGULARLY FOR ANY CHANGES. YOUR CONTINUED USE OF THIS WEBSITE AND/OR CONTINUED PROVISION OF PERSONAL INFORMATION TO US WILL BE SUBJECT TO THE TERMS OF THE THEN-CURRENT POLICY.</p>', '', '2021-02-10 18:19:33', '2021-02-10 18:19:33');
