(10, 'filing taxes freelance work', 'filing taxes freelance work', 'refund-policy', '<h1><strong>Refund Policy</strong></h1>\r\n\r\n<p>All commissions payable to ACCRONIC PRIVATE LIMITED by Service Professionals on consummated transactions, i.e. exchange of services for consideration, are final and non-refundable. All monies paid by Service Professionals in form of &ldquo;Monthly Subscription&rdquo; are non-interest bearing and shall be non-refundable to the Service Professionals.</p>\r\n\r\n<h3>Client Refund Policy</h3>\r\n\r\n<p>When a payment of fee is made to FROBITY, the fee paid in advance is retained by FROBITY in a client account. FROBITY will earn the fees upon working on a client&#39;s matter. During an engagement, FROBITY earns fee at different rates and different times depending on the completion of various milestones. Refund cannot be provided for earned fee because resources and man hours spent on delivering the service are non-returnable in nature. Further, we can&#39;t refund or credit any money paid to government entities, such as filing fees or taxes, or to other third parties with a role in processing your order. Under any circumstance, FROBITY shall be liable to refund only upto the fee paid by the client.</p>\r\n\r\n<h3>Refund Request</h3>\r\n\r\n<p>Refund request can be initiated through&nbsp;help@fineagle.com&nbsp;or&nbsp;create a refund request ticket. All refund requests must be made within 60 days of purchase. We will process your request within 15 to 25 business days of receiving all the information required for processing refund like reason for refund, bank details for processing request, etc.</p>\r\n\r\n<h3>Change of Service</h3>\r\n\r\n<p>If you want to change the service you ordered for a different one, you must request this change of service within 60 days of purchase. The purchase price of the original service, less any earned fee and money paid to government entities, such as filing fees or taxes, or to other third parties with a role in processing your order, will be credited to your FROBITY account. You can use the balance credit for any other FROBITY service.</p>\r\n\r\n<h3>Force Majeure</h3>\r\n\r\n<p>FROBITY shall not be considered in breach of its Satisfaction Guarantee policy or default under any terms of service, and shall not be liable to the Client for any cessation, interruption, or delay in the performance of its obligations by reason of earthquake, flood, fire, storm, lightning, drought, landslide, hurricane, cyclone, typhoon, tornado, natural disaster, act of God or the public enemy, epidemic, famine or plague, action of a court or public authority, change in law, explosion, war, terrorism, armed conflict, labor strike, lockout, boycott or similar event beyond our reasonable control, whether foreseen or unforeseen (each a &quot;Force Majeure Event&quot;).</p>\r\n\r\n<h3>Cancellation Fee</h3>\r\n\r\n<p>Since we&#39;re incurring costs and dedicating time, manpower, technology resources and effort to your service or document preparation, our guarantee only covers satisfaction issues caused by FROBITY - not changes to your situation or your state of mind. In case you require us to hold the processing of a service, we will hold the fee paid on your account until you are ready to commence the service.</p>\r\n\r\n<p>Before processing any refund, we reserve the right to make best effort to complete the service. In case, you are not satisfied with the service, a cancellation fee of 20% + earned fee + fee paid to government would be applicable. In case of change of service, the cancellation fee would not be applicable.</p>', '', '2021-02-11 11:04:30', '2021-02-11 11:04:30'),
(12, 'freelance tax consultant', 'filing taxes freelance work', 'about-us', '<h1><strong>About Us</strong></h1>\r\n\r\n<p>Frobity is an Indian freelancer-specific market website, centred around creating a platform where freelancers can offer their services to potential employers.</p>\r\n\r\n<p>Frobity strives to create connections between potential employers and employees by</p>', '', '2021-02-16 13:12:54', '2021-02-16 13:12:54'),
(13, 'freelancing websites for accountants', 'freelance work for accountants', 'jobs', '<h1><strong>Jobs</strong></h1>\r\n\r\n<ul>\r\n	<li>Chartered Accountant</li>\r\n	<li>Company Secerety</li>\r\n	<li>Accountant</li>\r\n	<li>Forms/Retuen Filling</li>\r\n	<li>Registration Services<br />\r\n	<br />\r\n	&nbsp;</li>\r\n</ul>', '', '2021-02-26 08:55:09', '2021-02-26 08:55:09'),
(14, 'hire freelancers india', 'hire freelance web designer', 'freelancers', '<h1><strong>Freelancers</strong></h1>\r\n\r\n<h2><strong>Hire freelancers in India at Frobity - India&rsquo;s trusted freelancing website</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Even before the novel Covid-19 existed, freelancing was evolving at a phenomenal speed. It was the trend not only in the US or Europe but also in India. And, the pandemic changed it all, forever! With work from home becoming inevitable and the new working regime for professionals, the world of freelancing has opened up like never before!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Today, freelancers are looked upon with similar respect as full-timers &ndash; they command good and desired rates. A plethora of assignments awaits deserving freelancers at Frobity.com - India&rsquo;s most trusted and mushrooming website for freelancers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Do you wish to engage premium and elite freelancers in India? Are you searching for top-class work quality at best rate? Welcome to Frobity!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The number one platform to hire freelancers in India</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>An ever-growing community of freelancers awaits you at Frobity &ndash; all of them are qualified and trained with domain expertise. Most of them are experienced, while some are just starting.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We at Frobity believe that it is our responsibility to ensure that you find the perfect match for your requirement to <strong>hire freelancers in India</strong>. To meet the growing demand for freelancers, we have designed and developed our online website with the latest tools and equipped it with advanced features. All to make your work easy and find the best qualified professionals to take up your freelance assignments.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As India&rsquo;s leading freelancing platform, these are the specialized sectors where you can <strong>hire freelancers in India</strong>:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://frobity.com/freelance-chartered-accountant\">Chartered Accountants</a></li>\r\n	<li>Company Secretary</li>\r\n	<li><a href=\"https://frobity.com/freelance-tax-and-accountants-work\">Accountants</a></li>\r\n	<li>IT consultants</li>\r\n	<li>Company registration consultants</li>\r\n	<li><a href=\"https://frobity.com/freelance-platform-for-web-developers\">Web designing and development</a></li>\r\n	<li>IT &amp; Networking</li>\r\n	<li>Data Sciences &amp; Analytics</li>\r\n	<li>Architecture</li>\r\n	<li><a href=\"https://frobity.com/hire-freelance-web-designer\">Designers</a></li>\r\n	<li>Writers</li>\r\n	<li>Translators</li>\r\n	<li>Legal professionals</li>\r\n	<li>Administrators</li>\r\n	<li>Customer service consultants and agents</li>\r\n	<li>Sales and marketing professionals</li>\r\n	<li>&nbsp;</li>\r\n</ul>', '', '2021-02-26 08:57:12', '2021-02-26 08:57:12'),
